import { Canvas } from '@react-three/fiber';
import { Html } from '@react-three/drei';

function Carta3D() {
  return (
    <Canvas>
      <ambientLight />
      <pointLight position={[10, 10, 10]} />
      <Html center>
        <div className="text-center p-4 bg-white rounded-lg shadow-lg">
          <h2 className="text-3xl">Minha Querida</h2>
          <p>Este é um pequeno lembrete de quanto você significa para mim...</p>
          <img src="/caminho/para/imagem.jpg" alt="Memória" className="mt-4 rounded-lg shadow-lg" />
          <video controls className="mt-4 rounded-lg shadow-lg">
            <source src="/caminho/para/video.mp4" type="video/mp4" />
          </video>
        </div>
      </Html>
    </Canvas>
  );
}

export default Carta3D;
